import React from "react";
import { Component } from "react";

class Cls_state extends Component{
    constructor(props){
        super();
        this.state={
            count: 0
        };
    }


    render(){
        return(
            <div>
                <h1>usin{this.state.count}</h1>
            </div>
        )
    }
}

export default Cls_state
